    data: |
      SELECT col0 AS col0 FROM tab0 (FORMAT parquet) WHERE 63 * - col2 / col2 - + + col2 + - + col1 * + + 9 IS NOT NULL;
  - name: tab0

outputs:
  - name: q1236.out
    data: |
      15
      87
      97
